description:
NHỈNH 12 TỶ BÁN NHÀ DÂN XÂY 42M2 x 5 TẦNG x  4 NGỦ ĐẸP PHỐ TĂNG BẠT HỔ, SÁT PHỐ, NGÕ Ô TÔ, MẶT TIỀN ĐẸP, SỔ ĐỎ VUÔNG ĐẸP.

+ Nhà vị trí đẹp và tiện ích miễn bàn. 5 phút chạy lên Hồ Gươm, Nhà Hát Lớn.
+ Thuộc khu vực trung tâm hành chính của Hà Nội, xung quanh toàn cơ quan nhà nước, rất hiếm nhà riêng bán.
+ Diện tích 42m2, mặt tiền bề thế ~5m, chủ tự xây 5 tầng:
- T1: Phòng khách (phòng học);
- T2: Phòng khách, phòng đọc sách, WC;
- T3,4 : mỗi tầng 1 phòng, WC;
- T5: Bếp, sân phơi.
+ Sổ đỏ riêng chính chủ, nở hậu vuông đẹp, giao dịch ngay.
Liên hệ Mr Hương để xem nhà, miễn trung gian, Môi giới làm phiền.

✅✅✅ NHỈNH 14 TỶ BÁN NHÀ 30M2 x 5 TẦNG MẶT PHỐ BÙI THỊ XUÂN, TRUNG TÂM PHỐ CỔ, ĐƯỜNG Ô TÔ TRÁNH 2 CHIỀU, VỈA HÈ KINH DOANH ĐẮC ĐỊA, SỔ ĐỎ ĐẸP. ✅✅✅

✅ Nhà tọa lạc mặt phố đẹp bậc nhất quận, 2 bên cây xanh thoáng mát.
✅ Khu phố cổ, gần trung tâm Hoàn Kiếm, kinh doanh nhà hàng, khách sạn nhộn nhịp, phố tập trung nhiều du khách nước ngoài và giới nhà giàu ghé thăm.
✅ Diện tích 30m2, chủ xây 5 tầng chắc chắn:
 Tầng 1: Thông sàn, bếp, wc;
 Tầng 2: Phòng Khách, Phòng ngủ;
 Tầng 3, 4: 2 phòng ngủ + VS;
 Tầng 5: Phòng Thờ, sân phơi.
✅ Sổ đỏ đẹp nở hậu. Giao dịch ngay.
Liên hệ Mr Hương để xem nhà, miễn Môi giới, trung gian làm phiền.
